Mongodb - aggregate items from array, matching item property or subarray item property<p>I have documents with the following structure:</p>

<pre><code>{
  _id: "UNIQUE_ID",
  myarray: [
    {
      mykey: '12345',
      // other fields
    },
    {
      // other fields
      nestedarray: [
        {
          mykey: '67890',
          // other fields
        }
      ]
    }
  ]
}
</code></pre>

<p>And I need to return all items from <code>myarray</code> on which <code>mykey</code> (on items of <code>myarray</code> or <code>nestedarray</code>) belongs to a set of values. For example, for the document above, if the set of values is <code>['12345, '67890']</code>, both items from <code>myarray</code> should be returned.</p>

<p>I'm using the following code to do that:</p>

<pre><code>collection.aggregate([
  {
    $match: {
      "_id": documentId,
      $or: [
        { "myarray": {$elemMatch: {"mykey": { $in: ['12345, '67890'] } } } },
        { "myarray.$.nestedarray": {$elemMatch: {"mykey": { $in: ['12345, '67890'] } }} }
      ]
    }
  },
  {
    $project: {
      myarray: {
        $filter: {
          input: '$myarray',
          as: 'arrayitem',
          cond: {
            $or: [
              { $eq: ["$$arrayitem.mykey", '12345'] },
              { $eq: ["$$arrayitem.nestedarray.[$].mykey", '12345'] }
            ]
          }
        }
      }
    }
  }
]);
</code></pre>

<p>But this only return the items on which <code>mykey</code> matches at <code>myarray</code> level (not matching it inside <code>nestedarray</code>).</p>

<p>What am I doing wrong?</p>

<p>Also, how may I use set <code>['12345, '67890']</code> instead of single value <code>'12345'</code> inside of $filter function?</p>

<p><strong>Clarifying:</strong></p>

<ul>
<li>If <code>mykey</code> match is on an item from <code>myarray</code>: include this item (this item will not have a <code>nestedarray</code> field)</li>
<li>If <code>mykey</code> match is on an item from <code>nestedarray</code>: include the item from <code>myarray</code> which contains <code>nestedarray</code> (also with full contents of <code>nestedarray</code>). This item from <code>myarray</code> will not have a <code>mykey</code> field</li>
</ul>

<p><strong>Example:</strong></p>

<p>Data:</p>

<pre><code>{
  _id: "UNIQUE_ID",
  myarray: [
    {
      mykey: '11111',
      // other fields
    },
    {
      // other fields
      nestedarray: [
        {
          mykey: '22222',
          // other fields
        },
        {
          mykey: '84325',
          // other fields
        }
      ]
    },
    {
      mykey: '645644',
      // other fields
    },
    {
      // other fields
      nestedarray: [
        {
          mykey: '23242',
          // other fields
        },
        {
          mykey: '23433',
          // other fields
        }
      ]
    }
  ]
}
</code></pre>

<p>Set of values: <code>['11111', '22222']</code></p>

<p>Expected query result:</p>

<pre><code>{
  _id: "UNIQUE_ID",
  myarray: [
    {
      mykey: '11111',
      // other fields
    },
    {
      // other fields
      nestedarray: [
        {
          mykey: '22222',
          // other fields
        },
        {
          mykey: '84325',
          // other fields
        }
      ]
    }
  ]
}
</code></pre>

