<p>Collection has documents like the one below.</p>

<pre><code>{
    _id: 5caa266c58b170106ff17f40,
    title: "Test2 88 bulkWrite",
    last_save_date: 2019-04-07T17:08:25.149+00:00,
    created_by: "McufNwnQX8YXC0tNSa1fdbt9Tus2",
    stories: [ { story_id: "1", objects: [...] },
               { story_id: "2", objects: [...] },
               { story_id: "3", objects: [...] },
                ... 
             ]    
 }

</code></pre>

<p>The ask is simple, when let's say a user clicks a button, the array element <code>{story_id: "2", objects: [...]}</code> is deleted, and all the elements with <code>story_id</code> of more than "2" ( s.a., "3", "4"...) are decremented by one (become "2" and "3"). </p>

<p>The first part, i.e., delete has been accomplished, but it's the second part which eludes me.
Here is the code:</p>

<pre><code>var storyId = ... (fetch from a request);
var intStoryId = parseInt( storyId) ;

